import React, { useState, useEffect, useCallback } from 'react';
import {
  Box,
  Container,
  Typography,
  Paper,
  Grid,
  CircularProgress,
  TextField,
  Button,
  Slider,
  Divider,
} from '@mui/material';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import StopsMap from './components/StopsMap';

interface Stop {
  stop_id: number;
  stop_name: string;
  latitude: number;
  longitude: number;
  routes: string[];
  distance: number;
}

interface Arrival {
  route: string;
  destination: string;
  arrival_time: string;
  minutes: number;
  is_delayed: boolean;
  route_color?: string;
}

interface StopsResponse {
  train_stops: Stop[];
  bus_stops: Stop[];
}

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

const DEFAULT_LOCATION: [number, number] = [41.8781, -87.6298]; // Chicago

function App() {
  const [location, setLocation] = useState<[number, number]>(DEFAULT_LOCATION);
  const [loading, setLoading] = useState(false);
  const [stops, setStops] = useState<StopsResponse>({ train_stops: [], bus_stops: [] });
  const [monitoredStops, setMonitoredStops] = useState<Stop[]>([]);
  const [error, setError] = useState<string | null>(null);

  const getLocation = useCallback(() => {
    if (!navigator.geolocation) {
      setError('Geolocation is not supported by your browser');
      return;
    }

    setLoading(true);
    navigator.geolocation.getCurrentPosition(
      (position) => {
        const newLocation: [number, number] = [
          position.coords.latitude,
          position.coords.longitude
        ];
        setLocation(newLocation);
        fetchNearbyStops(newLocation[0], newLocation[1]);
      },
      (error) => {
        setError('Error getting location: ' + error.message);
        setLoading(false);
      }
    );
  }, []);

  const fetchNearbyStops = async (lat: number, lon: number) => {
    try {
      setLoading(true);
      const response = await fetch(`http://localhost:8000/api/stops?lat=${lat}&lon=${lon}&radius=0.5`);
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setStops(data);
      setError(null);
    } catch (err) {
      setError('Error fetching stops: ' + (err as Error).message);
      setStops({ train_stops: [], bus_stops: [] });
    } finally {
      setLoading(false);
    }
  };

  const handleStopSelect = useCallback((stop: Stop) => {
    setMonitoredStops(prev => {
      if (!prev.some(s => s.stop_id === stop.stop_id)) {
        return [...prev, stop];
      }
      return prev;
    });
  }, []);

  useEffect(() => {
    getLocation();
  }, [getLocation]);

  return (
    <ThemeProvider theme={theme}>
      <Container maxWidth="lg" sx={{ py: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          CTA Transit Tracker
        </Typography>

        {error && (
          <Paper sx={{ p: 2, mb: 2, bgcolor: '#ffebee' }}>
            <Typography color="error">{error}</Typography>
          </Paper>
        )}

        <Button
          variant="contained"
          onClick={getLocation}
          disabled={loading}
          sx={{ mb: 2 }}
        >
          {loading ? <CircularProgress size={24} /> : 'Update Location'}
        </Button>

        <Paper sx={{ p: 2, mb: 2 }}>
          <StopsMap
            trainStops={stops.train_stops}
            busStops={stops.bus_stops}
            center={location}
            onStopSelect={handleStopSelect}
          />
        </Paper>

        {monitoredStops.length > 0 && (
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Monitored Stops
            </Typography>
            {monitoredStops.map((stop) => (
              <Paper key={stop.stop_id} sx={{ p: 2, mb: 1 }}>
                <Typography variant="subtitle1">{stop.stop_name}</Typography>
                <Typography variant="body2">
                  Routes: {stop.routes.join(', ')}
                </Typography>
                <Typography variant="body2">
                  Distance: {stop.distance.toFixed(2)} miles
                </Typography>
              </Paper>
            ))}
          </Paper>
        )}
      </Container>
    </ThemeProvider>
  );
}

export default App;
